import React from 'react';

const Tabs = ({ currentTab, setCurrentTab }) => {
  const tabInfo = [
    { id: 'internal', name: '내부치' },
    { id: 'kizuna', name: '키즈나' },
    { id: 'card', name: '카드렙' },
    { id: 'power', name: '종합력' },
    { id: 'fire', name: '이벤런' },
    { id: 'challenge', name: '챌라' },
  ];

  return (
    <div className="tabs">
      {tabInfo.map(tab => (
        <div
          key={tab.id}
          className={`tab ${currentTab === tab.id ? 'active' : ''}`}
          onClick={() => setCurrentTab(tab.id)}
        >
          {tab.name}
        </div>
      ))}
    </div>
  );
};

export default Tabs;
